import { Link } from "react-router-dom";

const Item = ({info}) => {
  return (
    <Link to = {`/detalle/${info.id}`}>
      <img src={info.img} alt="imagen" />
      <p>{info.precio}</p>
      </Link>
  )
};

export default Item;
